  _onIdle(e) {
    // console.log('user is idle', e)
    const isTimedOut = this.state.isTimedOut;

    if (isTimedOut) {
      // localStorage.clear()
      this.props.history.push('/dashboard');
    } else {
      this.setState({
        showModal: true
      });
      this.idleTimer.reset();
      this.setState({
        isTimedOut: true
      });
      this.setState({
        sessiondisable: true
      });
      setTimeout(() => {
        if (this.state.MovetoDashboard) {
          this.props.history.push('/dashboard');
        }
      }, this.state.modaltimeout); //15 seconds alert logout
    }
  }

