  async checkLock() {
    let data = {
      'PolicyId': this.props.match.params.id
    };
    await api.post('api/setLock', data).then(res => {
      if (res.success) {
        if (res.data[0].returnValue == '') {
          this.setState({
            isLock: false
          });
          return true;
        } else {
          this.setState({
            isLock: true,
            lockMsg: res.data[0].returnValue
          });
          return false;
