        loggedInUserId: CommonConfig.loggedInUserId(),
        Difference: this.state.totalMtdCharges.toFixed(2),
        IsLaidUpAshore: this.state.isLaidAshore
      };
    } else {
      pData.adjustmentData = {};
    }

    pData.PolicyMode = this.state.PolicyMode;
